    -0.171632 + -0.244131 * t."OUT_0"  + -0.180602 * t."OUT_1"  + -0.158420 * t."OUT_2"  + -0.140751 * t."OUT_3"  + -0.084815 * t."OUT_4"  + 0.213725 * t."OUT_5"  + 0.014699 * t."OUT_6"  + 0.013722 * t."OUT_7"  + -0.138245 * t."OUT_8"  + -0.179407 * t."OUT_9"  + -0.225984 * t."OUT_10"  + 0.081777 * t."OUT_11"  + -0.021790 * t."OUT_12"  + -0.241577 * t."OUT_13"  + 0.108163 * t."OUT_14"  + 0.064177 * t."OUT_15"  + 0.014040 * t."OUT_16"  + -0.076119 * t."OUT_17"  + -0.189438 * t."OUT_18"  + 0.084792 * t."OUT_19"  + 0.100826 * t."OUT_20"  + 0.201645 * t."OUT_21"  + 0.199350 * t."OUT_22"  + 0.225978 * t."OUT_23"  + -0.187212 * t."OUT_24"  + 0.144635 * t."OUT_25"  + 0.115046 * t."OUT_26"  + 0.047931 * t."OUT_27"  + 0.123817 * t."OUT_28"  + 0.021712 * t."OUT_29"  + -0.162426 * t."OUT_30"  + -0.128029 * t."OUT_31"  + 0.214395 * t."OUT_32"  + 0.009343 * t."OUT_33"  + -0.225683 * t."OUT_34"  + -0.241811 * t."OUT_35"  + 0.111132 * t."OUT_36"  + -0.001276 * t."OUT_37"  + -0.091425 * t."OUT_38"  + 0.150897 * t."OUT_39"  + -0.115002 * t."OUT_40"  + 0.054204 * t."OUT_41"  + -0.136826 * t."OUT_42"  + 0.177719 * t."OUT_43"  + -0.219832 * t."OUT_44"  + -0.229587 * t."OUT_45"  + -0.216479 * t."OUT_46"  + 0.149065 * t."OUT_47"  + -0.027326 * t."OUT_48"  + -0.051918 * t."OUT_49"  + 0.004705 * t."OUT_50"  + 0.075656 * t."OUT_51"  + -0.164863 * t."OUT_52"  + 0.225294 * t."OUT_53"  + -0.088209 * t."OUT_54"  + 0.027591 * t."OUT_55"  + 0.028467 * t."OUT_56"  + -0.207778 * t."OUT_57"  + -0.204661 * t."OUT_58"  + 0.074303 * t."OUT_59"  + -0.098588 * t."OUT_60"  + -0.201107 * t."OUT_61"  + 0.207363 * t."OUT_62"  + -0.095172 * t."OUT_63"  + 0.050728 * t."OUT_64"  + -0.196483 * t."OUT_65"  + 0.018311 * t."OUT_66"  + -0.058281 * t."OUT_67"  + 0.153361 * t."OUT_68"  + 0.231285 * t."OUT_69"  + 0.229669 * t."OUT_70"  + 0.053964 * t."OUT_71"  + -0.231809 * t."OUT_72"  + -0.204358 * t."OUT_73"  + 0.133595 * t."OUT_74"  + 0.216696 * t."OUT_75"  + -0.076437 * t."OUT_76"  + -0.123516 * t."OUT_77"  + -0.105947 * t."OUT_78"  + 0.103453 * t."OUT_79"  + -0.132128 * t."OUT_80"  + 0.178781 * t."OUT_81"  + -0.091203 * t."OUT_82"  + 0.030552 * t."OUT_83"  + -0.108039 * t."OUT_84"  + -0.033572 * t."OUT_85"  + 0.131948 * t."OUT_86"  + -0.022056 * t."OUT_87"  + -0.034336 * t."OUT_88"  + -0.064835 * t."OUT_89"  + 0.228733 * t."OUT_90"  + 0.157962 * t."OUT_91"  + -0.102848 * t."OUT_92"  + -0.023610 * t."OUT_93"  + 0.047856 * t."OUT_94"  + -0.053526 * t."OUT_95"  + 0.039003 * t."OUT_96"  + -0.229123 * t."OUT_97"  + 0.054306 * t."OUT_98"  + -0.067971 * t."OUT_99" AS "OUT_0"
 FROM "Hidden_Layer_1_Activation" AS t
),
model_scores_cte AS 
( SELECT t."index" AS "index",
   -0.5 * t."OUT_0" AS "Score_0",
   CAST(NULL AS FLOAT) AS "Proba_0",
   CAST(NULL AS FLOAT) AS "LogProba_0",
   0.5 * t."OUT_0" AS "Score_1",
   CAST(NULL AS FLOAT) AS "Proba_1",
   CAST(NULL AS FLOAT) AS "LogProba_1"
  FROM "Output_Layer_BA" AS t ),
soft_max_orig_cte AS 
( SELECT t."index" AS "index", 
   t."Score_0" AS "Score_0",
   t."Proba_0" AS "Proba_0",
   t."LogProba_0" AS "LogProba_0",
   t."Score_1" AS "Score_1",
   t."Proba_1" AS "Proba_1",
   t."LogProba_1" AS "LogProba_1",
   CAST(NULL AS BIGINT) AS "Decision",
   CAST(NULL AS FLOAT) AS "DecisionProba",
   GREATEST( t."Score_0", t."Score_1" ) AS "Greatest_Score"
  FROM
    model_scores_cte AS t
),
soft_max_cte_with_exp_deltas AS 
( SELECT t1."index" as "index",
    t1."Proba_0" AS "Proba_0",
    t1."Score_0" AS "Score_0",
    t1."Exp_Score_0" AS "Exp_Score_0",
    t1."Proba_1" AS "Proba_1",
    t1."Score_1" AS "Score_1",
    t1."Exp_Score_1" AS "Exp_Score_1",
    ( t1."Exp_Score_0" + t1."Exp_Score_1" ) AS "Sum_Exp"
  FROM
   ( SELECT t."index" as "index",
        t."Proba_0" AS "Proba_0",
        t."Score_0" AS "Score_0",
        t."Proba_1" AS "Proba_1",
        t."Score_1" AS "Score_1",
        EXP(t."Score_0" - t."Greatest_Score") as "Exp_Score_0",
        EXP(t."Score_1" - t."Greatest_Score") as "Exp_Score_1"
    FROM
       soft_max_orig_cte AS t
  ) AS t1
),
soft_max_cte AS 
( SELECT t1."index" AS "index",
    t1."Exp_Score_0" / t1."Sum_Exp" AS "Proba_0",
    t1."Score_0" AS "Score_0",
    t1."Exp_Score_1" / t1."Sum_Exp" AS "Proba_1",
    t1."Score_1" AS "Score_1"
 FROM 
   soft_max_cte_with_exp_deltas as t1
),arg_max_cte_with_max_proba AS 
( SELECT t."index" AS "index",
    t."Proba_0" AS "Proba_0",
    t."Score_0" AS "Score_0",
    t."Proba_1" AS "Proba_1",
    t."Score_1" AS "Score_1",
    GREATEST( t."Proba_0", t."Proba_1" ) AS "Max_Proba",
    GREATEST( t."Score_0", t."Score_1" ) AS "Max_Score"
  FROM
     "soft_max_cte" AS t
),
arg_max_cte_with_max_proba_idx AS 
( SELECT t."index" as "index",
    t."Proba_0" AS "Proba_0",
    t."Score_0" AS "Score_0",
    t."Proba_1" AS "Proba_1",
    t."Score_1" AS "Score_1",
    CASE WHEN(t."Proba_0" = t."Max_Proba") THEN 0 else NULL END AS "max_idx_0",
    CASE WHEN(t."Proba_1" = t."Max_Proba") THEN 1 else NULL END AS "max_idx_1",
    t."Max_Proba" AS "Max_Proba",
    t."Max_Score" AS "Max_Score"
  FROM
   "arg_max_cte_with_max_proba" AS t
),
arg_max_cte AS 
( SELECT t."index" as "index",
     t."Proba_0" AS "Proba_0",
     t."Score_0" AS "Score_0",
     t."Proba_1" AS "Proba_1",
     t."Score_1" AS "Score_1",
     t."Max_Proba" AS "Max_Proba",
     t."Max_Score" AS "Max_Score",
     COALESCE(  t."max_idx_0", t."max_idx_1" ) AS argmax_class_idx
   FROM
     "arg_max_cte_with_max_proba_idx" AS t
)
SELECT arg_max_cte."index" AS "index",
  arg_max_cte."Score_0" AS "Score_0",
  arg_max_cte."Proba_0" AS "Proba_0",
  CASE WHEN (arg_max_cte."Proba_0" IS NULL OR arg_max_cte."Proba_0" > 0.0) THEN LN( arg_max_cte."Proba_0" ) ELSE -1.79769313486231e+308 END AS "LogProba_0",
  arg_max_cte."Score_1" AS "Score_1",
  arg_max_cte."Proba_1" AS "Proba_1",
  CASE WHEN (arg_max_cte."Proba_1" IS NULL OR arg_max_cte."Proba_1" > 0.0) THEN LN( arg_max_cte."Proba_1" ) ELSE -1.79769313486231e+308 END AS "LogProba_1",
  arg_max_cte."argmax_class_idx" AS "Decision",
  arg_max_cte."Max_Proba" AS "DecisionProba"
FROM arg_max_cte